module DataMem(
    input logic clk,
    input logic rst,
    input logic [6:0] /*RA,*/ WA,
    input logic write,
    input logic [31:0] in,
    output logic [31:0] out
    );

    logic [31:0] register [127:0];

    always_ff @ (posedge clk) begin
        if (rst) begin
            register = '{128{0}};
        end
        else begin
            if (write) begin
                register[WA] <= in;
            end
 /*           else begin
                out = register[RA];
            end */
        end
    end
    assign out = register[WA];
endmodule

module Processor_tb;

    logic clk;
    logic rst;

    Processor p0 ( .clk(clk), .rst(rst));

    initial begin
        clk = 1'b0;
        forever #10 clk = ~clk;
    end

    initial begin
        rst = 1'b1;
        #30 rst = 1'b0;
    end
endmodule

