#include "Constants.h"
#include "Image.h"
#include "FileIO.h"





unsigned char GetPixelR(const IMAGE *image, unsigned int x, unsigned int y){
        assert(image);
        unsigned char R = (image->R[x + y * image->Width]);
        return (R);
}

unsigned char GetPixelG(const IMAGE *image, unsigned int x, unsigned int y){
        assert(image);
        unsigned char G = (image->G[x + y * image->Width]);
        return (G);
}

unsigned char GetPixelB(const IMAGE *image, unsigned int x, unsigned int y){
        assert(image);
        unsigned char B = (image->B[x + y * image->Width]);
        return (B);
}


void SetPixelR(IMAGE *image, unsigned int x, unsigned int y, unsigned char r){
        assert(image);
        image->R[x + y * image->Width] = r;
}

void SetPixelG(IMAGE *image, unsigned int x, unsigned int y, unsigned char g){
        assert(image);
        image->G[x + y * image->Width] = g;
}


void SetPixelB(IMAGE *image, unsigned int x, unsigned int y, unsigned char b){
        assert(image);
        image->B[x + y * image->Width] = b;
}
IMAGE *CreateImage(unsigned int Width, unsigned int Height){
        IMAGE *image;
        image = malloc(sizeof(IMAGE));
        image->R  = (unsigned char *)malloc(Width * Height);
        image->G  = (unsigned char *)malloc(Width * Height);
        image->B  = (unsigned char *)malloc(Width * Height);
        if (! image){
                perror("No Memory!\n");
                exit(10);
        }
        image->Width = Width;
        image->Height = Height;
        return image;
}


void DeleteImage(IMAGE *image){
        assert(image);
        free(image);
}
